const MuseumDetailste = ({ triggerNextStep, previousStep }) => {
    const { value: city } = previousStep;
    const museumste = museumsDataTe[city] || []; // Telugu data
  
    const handleSelectMuseum = (museumName) => {
      triggerNextStep({ value: museumName });
    };
  
    return (
      <div style={{ display: 'flex', overflowX: 'scroll' }}>
        {museumste.map((museum, index) => (
          <div key={index} style={{ minWidth: '250px', marginRight: '15px', textAlign: 'center' }}>
            <h3>{museum.nameTe}</h3>
            <img
              src={museum.imageTe}
              alt={museum.nameTe}
              style={{ width: '200px', height: '150px', objectFit: 'cover', borderRadius: '5px' }}
            />
            <p>{museum.locationTe}</p>
            <p>{museum.timingsTe}</p>
            <button onClick={() => handleSelectMuseum(museum.nameTe)}>
              {museum.nameTe}
            </button>
            <br />
            {/* Location Button */}
            <a href={museum.mapsLinkTe} target="_blank" rel="noopener noreferrer">
              <button style={{ marginTop: '5px' }}>లొకేషన్</button>
            </a>
          </div>
        ))}
        {!museumste.length && <p>ఈ నగరంలో మ్యూజియమ్స్ లేవు.</p>}
      </div>
    );
  };
  

export default MuseumDetailste;